import './App.css';
import './gracepic.png';
import FoodProfile from './FoodProfile';

function App() {
  const userData = {
    username: '@gracelhu',
    profilePicture: 'gracepic.png',
    friends: [
      { id: 1, username: 'Friend1' },
      { id: 2, username: 'Friend2' },
    ],
    ingredients: [
      { id: 1, name: 'Eggs', quantity: 6 },
      { id: 2, name: 'Tomatoes', quantity: 3 },
    ],
    savedRecipes: [
      { id: 1, name: 'Scrambled Eggs' },
      { id: 2, name: 'Tomato Salad' },
    ],
  };

  return (
    <div className="App">
      <FoodProfile 
        username={userData.username}
        profilePicture={userData.profilePicture}
        friends={userData.friends}
        ingredients={userData.ingredients}
        savedRecipes={userData.savedRecipes}
      />
    </div>
  );
}

export default App;
